import React from 'react'
import styled from 'styled-components'
import logo from '../asset/images/logo.png'
const Header = () => {

const HeaderContainer = styled.div`
  background: #f44336;
  height: 100%;
  width: 100%;
  display: flex;
  align-items: center;
  padding: 10px 0;
  justify-content: space-between;
`
const Header_Lefl = styled.div`
    display: flex;
    padding: 5px;
`
const Header_Logo = styled.div`
    img{
        height: 40px;
        width: 40px;
    }
`
const Title = styled.div`
    display: flex;
    color: white;
    font-size: 20px;
    font-weight: 500;
    align-items: center;
    margin-left: 5px;
`

  return (
    <HeaderContainer>
        <Header_Lefl>
            <Header_Logo>
                <img src={`${logo}`} />
            </Header_Logo>
            <Title>TimeSheet</Title>
        </Header_Lefl>
    </HeaderContainer>
  )
}

export default Header
